import React from 'react';
import './Header.css';

class Header extends React.Component {

  constructor(props) {
      super(props);
  };

  render() {
    let page = this.props.page;
    let goToHome = this.props.goToHome;
    let goToAbout = this.props.goToAbout;
    return (
      <div>
        <div className="header">
          <div className="header__content">
            <div className="logo"> YJ Kim </div>
            <div className="settings">
              <div class="home" onClick={goToHome}> home </div>
              <div class="about" onClick={goToAbout}> about </div>
            </div>
          </div>
        </div>
        <div>
          <div class="hello">Hello! I'm YJ</div>
          <img src="https://i.ibb.co/BNXhKdX/Continuous-one-line-drawing-of-abstract-girl-face-Beauty-women-sketch-hand-drawn-vector-illustration.jpg"/>

        </div>
        </div>
    );
  }
}

export default Header;
